[[File:Alice chathead.png|left]]
'''Alice''' is a widow who runs the [[Alice's farm|family farm]] west of [[Port Phasmatys]]. She runs the [[Alice's Farming shop.|shop]] while her daughter [[Lyra]] watches over the nearby [[Farming/Patch locations|herb and allotment patches]] and her [[Alice's husband|deceased husband]] manages the undead livestock. Her daughter ensures they do not pay the [[blood tithe]]s by luring young farmers back to their farm, using them to pay the tithe instead.{{CiteNPC|npc=Lyra|quote=Sometimes I travel to market fairs in distant lands, and I use my feminine arts to lure young farmers back to this land; then the vampyres come for them and I see them no more.|loc=Garden of Tranquility}}

Many years ago, the power of the [[ectofuntus]] killed her husband and all their cows and chickens, resurrecting them as a ghost and [[undead cow]]s and [[Undead chicken|chickens]].{{CiteNPC|npc=Alice's husband|quote=All I know is, years ago, that temple started glowing green and, a few months later, I woke up dead.|loc=Animal Magnetism}}{{CiteNPC|npc=Alice's husband|quote=It's that fountain thingy in the temple to the east. It's turned them all into zombies.|loc=Animal Magnetism}} Despite this, they continued to run the farm, but this caused trouble in communication, as she refused to use a [[ghostspeak amulet]]. The last time she tried, the amount of undead that she heard scared her.{{CiteNPC|npc=Alice|quote=I tried that once, but all those other ghosts - and even the undead chickens and cows - scared me so much, I wouldn't try it again for all the cash in Varrock bank.|loc=Animal Magnetism}} In particular, this caused her financial worry as she couldn't find their savings, unaware that her husband had placed them in the [[bank]].

When an adventurer came by seeking [[Undead chicken (item)|undead chickens]], she asked them for help. They acted as an intermediary for the couple until the husband refused to give out his [[Bank PIN|pass number]], believing the intermediary to be a scammer. The adventurer sought the aid of a [[old crone|nearby witch]], who gave them a [[Crone-made amulet|special ghostspeak amulet]] for the husband, allowing him to talk to his wife. They started selling the undead chickens for 20 [[ecto-token]]s each after that, saving up to buy killer cows to repel those who attack their livestock.{{CiteNPC|npc=Alice's husband|quote=Great! I'm laying away me tokens for some killer cows. That'll learn them bone rustlers.|loc=Animal Magnetism}}

